import React,{useContext} from 'react'
import { useEffect } from 'react'
import ProductContext from '../contexts/productContext/productContext'
const home = () => {
  const productContext = useContext(ProductContext)
  console.log(productContext.ProductStoreContext.products)

  useEffect(()=>{
    async function fetchData(){
      const f = await productContext.ProductStoreContext.productsWithCount(5);
      console.log(f)
    }
    fetchData()
  },[productContext])

  return (
    <div>home</div>
  )
}

export default home
